var initProvince_UserCenter = function(divLable){
	$("#"+divLable).html("");
	var Pro_ul = document.body.querySelector('#'+divLable);
	for(var i=0; i<provinceList.length; i++){
		var addHtml = "{pro_name}";
		var proName = provinceList[i].name;
		addHtml = addHtml.replace('{pro_name}', proName);
		var li = document.createElement('li');
		li.innerHTML = addHtml;
		li.className = "DFPACcityList";
		li.id = i;
		Pro_ul.appendChild(li);
	}
	eachLiAddProvinceClick2();
}


function eachLiAddProvinceClick2(){
	$.each(document.querySelectorAll('.DFPACcityList'), function() {
		this.addEventListener('tap',function(){
			var id = $(this).attr("id");
			var proName = $(this).html();
			var username = GetPageParams("username");
			var usersex = GetPageParams("usersex");
			var userphone = GetPageParams("userphone");
			var DFMIbtnDate = GetPageParams("DFMIbtnDate");
			var usercity = GetPageParams("usercity");
			var url = 'DFArea.html?proId=' + id+'&username='+username+'&usersex='+usersex+'&userphone='+userphone+'&DFMIbtnDate='+DFMIbtnDate;
			url = encodeURI(url);
			window.location.href = url;
		});
	});
}

function loadCity_UserCenter(id, proName, divLable) {
	$("#"+divLable).html("");
	var City_ul = document.body.querySelector('#'+divLable);
	var Pro_cityList = provinceList[id].cityList;
	for(var i=0; i<Pro_cityList.length; i++){
		var addHtml = "{city_name}";
		var cityName = Pro_cityList[i].name;
		addHtml = addHtml.replace('{city_name}', cityName);
		var li = document.createElement('li');
		li.innerHTML = addHtml;
		li.className = "DFPACcityList";
		li.id = proName + "_"+ i;
		
		City_ul.appendChild(li);
	}
	eachLiAddCityClick2();
}
