function eachLiAddProvinceClick(){
	$.each(document.querySelectorAll('.loadCity'), function() {
		this.addEventListener('tap',function(){
			var id = $(this).attr("id");
			var proName = $(this).html();
			$(this).addClass('scrollerbj');
			$(this).siblings().removeClass('scrollerbj');
			loadCity(id, proName, "city_name");
			$('.DFSNMaskMeu').show();
			$('.rightBigContent').show();
		});
	});
}

function loadCity(id, proName, divLable) {
	$("#"+divLable).html("");
	var City_ul = document.body.querySelector('#'+divLable);
	var Pro_cityList = jxsAreaList[id].cityList;
	if(Pro_cityList){
		for(var i=0; i<Pro_cityList.length; i++){		
			var citycode = Pro_cityList[i].pCode;
			var arealist = Pro_cityList[i].areaList;
			if(citycode=='110000'||citycode=='310000'||citycode=='120000'||citycode=='500000'){
				for(var j=0; j<arealist.length; j++){
					var addHtml = "{city_name}";
					var cityName = arealist[j].name;
					addHtml = addHtml.replace('{city_name}', cityName);
					var li = document.createElement('li');
					li.innerHTML = addHtml;
					li.className = "getCityName";
					li.id = proName + "_"+ cityName;
					City_ul.appendChild(li);
				}
			}else{
				var addHtml = "{city_name}";
				var cityName = Pro_cityList[i].name;
				addHtml = addHtml.replace('{city_name}', cityName);
				var li = document.createElement('li');
				li.innerHTML = addHtml;
				li.className = "getCityName";
				li.id = proName + "_"+ cityName;
				City_ul.appendChild(li);
			}
				

		}
	}
	//var Pro_cityList = provinceList[id].cityList;
	//for(var i=0; i<Pro_cityList.length; i++){
	//	var addHtml = "{city_name}";
	//	var cityName = Pro_cityList[i].name;
	//	addHtml = addHtml.replace('{city_name}', cityName);
	//	var li = document.createElement('li');
	//	li.innerHTML = addHtml;
	//	li.className = "getCityName";
	//	li.id = proName + "_"+ cityName;
		
	//	City_ul.appendChild(li);
	//}
	eachLiAddCityClick();
}

function eachLiAddCityClick(){
	$.each(document.querySelectorAll('.getCityName'), function() {
		this.addEventListener('tap',function(){
			var id = $(this).attr("id");
			var cityName = $(this).html();
			$("#page").val(1);
			$("#selectedCity").val(id);
			$(".DFNSmenuTitle").html(cityName);
			$('.DFSNMaskMeu').hide();
			$('.rightBigContent').hide();
			reloadShop4s(id);
		});
	});
}

function getAreaCode(cityname){
		var obj = areacode.body;
		for(var i=0;i<obj.length;i++) {
			if(obj[i].city == cityname){
				return obj[i].cityId;
			}
		}
}

function getAreaName(citycode){
		var obj = areacode.body;
		for(var i=0;i<obj.length;i++) {
			if(obj[i].cityId == citycode){
				return obj[i].city;
			}
		}
}

function existsCode(cityname){
	if(jxsAreaList&&jxsAreaList.length>0){
		for(var i=0;i<jxsAreaList.length;i++) {
				if(jxsAreaList[i].name == cityname){
					return true;
				}
			}
		}
}

